import React, {Component}  from 'react'
import {connect} from 'react-redux';
import {bindActionCreators} from 'redux';
import { Container, Row, Col} from 'reactstrap'
import Button from 'react-bootstrap/Button'
import Card from 'react-bootstrap/Card'
import Select from 'react-select'
import ListGroup from 'react-bootstrap/ListGroup'

const scaryAnimals = [
    { label: "Alligators", value: 1 },
    { label: "Crocodiles", value: 2 },
    { label: "Sharks", value: 3 },
    { label: "Small crocodiles", value: 4 },
    { label: "Smallest crocodiles", value: 5 },
    { label: "Snakes", value: 6 },
  ];

class ConsultarMovimentacao extends Component{

    constructor(props){
        super(props);    
    }
    state = {
        listitems: ["List Item 1", "List Item 2", "List Item 3"]
      };
    render(){
        return(
            <div>      
                <h1>Consultar Movimentação</h1>
                <Container>
                        <Row>
                            <Col md={12}>
                                <Card>
                                    <Card.Header>Filtro</Card.Header>
                                    <Card.Body>
                                    <Row>
                                        <Col md={3}>
                                        <label>Matriz Contábil</label>
                                        <div className="container">
                                            <Select options={scaryAnimals} />
                                        </div>


                                        <ListGroup>                                            
                                            {this.state.listitems.map(listitem => (
                                                <ListGroup.Item>
                                                    {listitem} <Button variant="primary">X</Button>
                                                </ListGroup.Item>
                                            ))}
                                        </ListGroup>
                                      

                                        </Col>
                                    </Row>
                                        <Button variant="primary">Go somewhere</Button>
                                    </Card.Body>
                                </Card>
                            </Col>
                        </Row>
                </Container>
                
            </div>  
        )
      }        

}
    
function mapDispatchToProps(dispatch){
    return bindActionCreators({}, dispatch);
}
export default connect(null, mapDispatchToProps)(ConsultarMovimentacao);
